import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Div from './components/Div';

export default function Priority1() {
  const [users_data, setusers_data] = useState(null);

  const fetchData = async () => {
    try {
      const response = await axios.get('https://api.quicksell.co/v1/internal/frontend-assignment');
      setusers_data(response.data.users);
    } catch (error) {
      console.error('Axios error:', error);
    }  
  };
  
  useEffect(() => {
    fetchData();
  }, []);

  const user_name_assign = () => {
    const map = {};
    const new_user_id = [];

    for (const i of users_data) {
      new_user_id.push(i.id);
      map[i.id] = i.name;
    }

    const list_of_divs = new_user_id.map((user_id) => (
      <Div map={map} key={user_id} user_id={user_id} />
    ));

    return list_of_divs;
  };

  return <div style={{display:"flex"}}>{users_data && user_name_assign()}</div>;
}
